import React from "react";
import Container from "@mui/material/Container";
import Input from "@mui/joy/Input";
import Grid from "@mui/joy/Grid";
import Typography from "@mui/material/Typography";
import Button from "@mui/joy/Button";

const usestyles = makestyles((theme) => ({
  root: {
    "& .muifilledinput-root": {
      background: "rgb(232, 241, 250)",
    },
  },
}));

export default function Login() {
  return (
    <Container
      maxWidth="sm"
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh",
      }}
    >
      <Container
        maxWidth="sm"
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          height: "40vh",
          width: "40vh",
          backgroundColor: "rgb(5, 22, 34)",
        }}
      >
        <Grid
          container
          direction="column"
          justifyContent="center"
          alignItems="center"
          spacing={4}
          sx={{ flexGrow: 1 }}
        >
          <Grid
            container
            direction="column"
            justifyContent="center"
            alignItems="center"
            xs={12}
          >
            <Typography variant="h3" color="rgb(252, 252, 252)">
              Login
            </Typography>
          </Grid>
          <Grid
            container
            direction="column"
            justifyContent="center"
            alignItems="center"
            spacing={3}
            sx={{ flexGrow: 1 }}
          >
            <Grid xs={12}>
              <Input placeholder="Type your Username" variant="soft" />
            </Grid>
            <Grid
              container
              direction="column"
              justifyContent="center"
              alignItems="center"
              spacing={1}
              sx={{ flexGrow: 1 }}
            >
              <Grid xs={12}>
                <Input placeholder="Type your Password" variant="soft" />
              </Grid>
              <Typography
                variant="caption"
                color="rgb(252, 252, 252)"
                sx={{ ml: 10 }}
              >
                Dimenticato la Password?
              </Typography>
            </Grid>
          </Grid>
          <Grid
            container
            direction="row"
            justifyContent="center"
            alignItems="center"
            spacing={3}
            xs={12}
          >
            <Grid>
              <Button variant="solid">Sign Up</Button>
            </Grid>
            <Grid>
              <Button variant="solid">Sign In</Button>
            </Grid>
          </Grid>
        </Grid>
      </Container>
    </Container>
  );
}
